            item
            lg={3}
            sm={6}
            xl={3}
            xs={12}
          >
          <MostCommon />
          </Grid>
          <Grid
            item
            lg={3}
            sm={6}
            xl={3}
            xs={12}
          >
          <LeastCommon />
          </Grid>
          <Grid
            item
            lg={3}
            sm={6}
            xl={3}
            xs={12}
          >
            <DiagnosesBarChart />
          </Grid>
          <Grid
            item
            // lg={1}
            md={1}
            // xl={1}
            // xs={1}
          >
            {/* <TrafficByDevice />
          </Grid>
          <Grid
            item
            lg={4}
            md={6}
            xl={3}
            xs={12}
          > */}
            {/* <LatestProducts />
